// src/App.jsx
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Login from './Pages/Login';
import Register from './Pages/Register';
import DashboardAdmin from './Pages/Dashbord/DashboardAdmin';
import DashboardMinistere from './Pages/DashboardMinistere';
import DashboardEntreprise from './Pages/DashboardEntreprise';
import Home from './Pages/Home'; // Assure-toi du bon casing (Pages ou pages)

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Authentification */}
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Dashboards par rôle */}
        <Route path="/dashboard/admin" element={<DashboardAdmin />} />
        <Route path="/dashboard/ministere" element={<DashboardMinistere />} />
        <Route path="/dashboard/entreprise" element={<DashboardEntreprise />} />

        {/* Page d’accueil */}
        <Route path="/home" element={<Home />} />

        {/* Redirection si route inconnue */}
        <Route path="*" element={<Navigate to="/home" replace />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
